            <h2 style="display:inline;">Morpheus<br></h2>

         Morpheus heeft haar te pakken.<br><br>Maker van menselijke gedaanten. Zij is even weg van zichzelf, buigt nu voorover. Knikkebolt.<br><br>Ze neemt zo haar plaats weer in het dagelijkse leven, de kraam is net ingericht voor de verkoop.<br><br>Ik weet niet hoe het is afgelopen. Schrok ze wakker, of werd ze door een passant glimlachend op de schouder getikt, en &hellip; in de loop van de dag zal ze haar spulletjes hebben aangeprezen, en een en ander verkocht &hellip;<br><br>Of ging het met een schok, misschien seconden na het wegzakken &hellip;  viel ze op de grond?<br><br>De foto vertelt niet veel, ze is net zo ver weg als haar dromen, we weten niet wie ze is, en waarom ze daar zo moe is geworden. De fotograaf geeft haar vorm, en misschien als ze zichzelf weer terugziet, zal zij weten hoe ze daar zat, en merken dat het leven verder gaat &hellip; ook al ben je er niet meer bij &hellip;<br><br>De schrijver gooit met woorden, in de richting waar zij was.<br><br>Het weekend  intensief, en de shit is uitgewerkt, terwijl je juist weer moet beginnen. <br><br>Het is nog rustig op de markt, en nu alles staat, kan ik best even zitten. <br><br>Ze knakt, even. De warmte? Het zonlicht strijkt langs haar silhouet en zoekt vriendelijk warm naar de marktgangers. Het mooie herfstweer maakt het drukker. <br><br>Ze laten haar met rust, lijkt het. Ze lopen weg, blijven even wachten. Alles valt stil.<br><br>Haar rug kromt, op zoek naar nieuwe energie. <br><br>Ze schudt alle verhalen van zich af, en staat op. Draait zich om, kijkt nog een keer naar de uitstalling, goed gepresenteerd &hellip;?<br><br>Ze stelt zich achter de kraam, haar wil &ndash; ze straalt het uit &ndash; dwingt de marktgangers tot kopen.<br><br>Zo kan het  aflopen.<br><br> 
